import { Breadcrumb, Menu } from 'antd';
const menu = (
  <Menu
    items={[
      {
        key: '1',
        label: (
          <a target="_blank" rel="noopener noreferrer" href="http://www.alipay.com/">
            General
          </a>
        ),
      },
    ]}
  />
);

const Bc = () => (
  <Breadcrumb>

    <Breadcrumb.Item overlay={menu}>
      <a href="">General Journal</a>
    </Breadcrumb.Item>
  </Breadcrumb>
);

export default Bc;
